description:
The last time Paul Thomas visited The Masseuse, he won Best Picture and  swept the AVN Awards from start to finish. Now he's back. And look who's  at the table. Jenna. The world's biggest star in one of her most daring  roles. Filled with domination, restraints, chains, and even a little  oil for those aching muscles. Jenna Jameson Is The Masseuse. And that's  the rub.  Winner of Best Director, Best Actor, and Best Actress from  AVN.

